import React from 'react';
// import logo from './logo.svg';
import './App.css';
import DataScrap from './DataScrap';
import Navbar from './components/Navbar'
import Page from './components/Pagination'

function App() {
  return (
    <div className="App">
      <Navbar/>
      <DataScrap />
      <Page/>
    </div>
  );
}

export default App;
